import {Routes, Route } from 'react-router-dom';
import homePage from './pages/homePage';
import resultPage from './pages/resultPage';

function App(){
  return(
    <div className='App'>
      <Routes>
        <Route path="/" element={<homePage />}></Route>
        <Route path="/resultPage" element={<resultPage />}></Route>
      </Routes>
    </div>

  );
}
export default App;
